import React from 'react'

var stylingObject = {
    container: {
        width: "100%",
        height: "70px",
        background: "red",
        padding: "5px 50px"
    }
}

function homeNav() {
    return (
        <div style = {stylingObject.container}>
            hello
        </div>
    )
}

export default homeNav
